import React, { Component } from 'react';
import {StyleSheet, View, Text, Image} from 'react-native';

class App extends Component{
  render(){

    let nome = 'Renê Pádua';
    let img = 'https://avatars.githubusercontent.com/u/81319888?s=100&v=4';
    let idade = 'Idade: 37';
    let local = 'Residente: SP';
    let formacao = 'Formação: Sistemas para Internet';
    let xprof = 'Experiência Profissional: Estagiário em Equipe Web, Fatec-BS';
    let github = 'GitHub: https://github.com/RenePadua';


    return(
      <View style={{backgroundColor:'#161b22'}}>
        <Text style={{color: '#fff', fontSize: 30, margin: 5 }}>{nome}</Text>

        <Image
          source={{ uri: img }}
          style={{borderRadius: 100, width: 150, height: 150}}
        />

        <Text style={{ fontSize: 15 }}>{idade}</Text>
        <Text style={{ fontSize: 15 }}>{local}</Text>
        <Text style={{ fontSize: 15 }}>{formacao}</Text>
        <Text style={{ fontSize: 15 }}>{xprof}</Text>
        <Text style={{ fontSize: 15 }}>{github}</Text>



      </View>
    )
  }
}

export default App;

